import React from 'react'
import Navbar from '../../components/Navbar'
import Retail_sidebar from '../../components/Retail_sidebar'

function rt_cart() {
  return (
    <>
    <Navbar/>
    <Retail_sidebar/>
    <div rt>rt_cart</div>
    </>
  )
}

export default rt_cart
